import styled from "styled-components"
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome"

export const NavIconMenu = styled.div`
    position: absolute;
    top: 0;
    right: 0;
    padding: 17px 20px;
`

export const Bars = styled(FontAwesomeIcon)`
    color: #228aff;
    font-size: 36px;
`
